import React from "react";
import { View, Text, Image, StyleSheet } from "react-native";

const Restaurant = (props) => {
  return (
    <View>
      <Text style={style.name}>{props.name}</Text>
      <Image
        source={{
          uri: props.source,
        }}
      />
    </View>
  );
};

const style = StyleSheet.create({
  name: {
    fontSize: 28,
    textAlign: "center",
  },
});

export default Restaurant;
